was not a contract or bubbling up the revert reason (falling back to {Errors.FailedCall}) in case
of an unsuccessful call.

@title OTDS1
@dev A smart contract that allows merchants to accept deposits in ERC20 tokens and native cryptocurrency,
     with an integrated commission system.

